import * as jsPDF from "jspdf";

export class Filemanagement {

  public static downloadPDF(innerHTML: string, typeOfReport: string){

      let doc = new jsPDF();
      let file = "fileUploadError"+new Date()+".pdf";
      let  specialElementHandlers = {
        '#editor': function (element, renderer) {
          return true;
        }
      };

      var imgData = new Image();
      imgData.src = 'data:image/png;base64,';
      doc.addImage(imgData, 'JPEG', 8, 20, 50, 15);
      doc.setDrawColor(150,150,150);
      //doc.text('Rapport derreur',x:20,y:30,w:40,h:30);

      if(typeOfReport === 'affiliation'){
        doc.text('Rapport d\'Erreur des Affiliations',85,40,null,null,null);
      }
      if(typeOfReport === 'instrument'){
        doc.text('Rapport d\'Erreur des Instruments',85,40,null,null,null);
      }
      if(typeOfReport === 'position'){
        doc.text('Rapport d\'Erreur des Positions',85,40,null,null,null);
      }
      if(typeOfReport === 'mouvement'){
        doc.text('Rapport d\'Erreur des Mouvements',85,40,null,null,null);
      }
      doc.line(17, 45, 200, 45);
      doc.fromHTML(innerHTML, 17, 45, {
        'width': 190,
        'elementHandlers': specialElementHandlers,
      });

      doc.save(file);
  }

  public static downloadPDFModules(innerHTML: string, typeOfReport: string){

    let doc = new jsPDF();
    let file = "reportFile"+new Date()+".pdf";
    let  specialElementHandlers = {
      '#editor': function (element, renderer) {
        return true;
      }
    };

    var imgData = new Image();
    imgData.src = 'data:image/png;base64,';
    doc.addImage(imgData, 'JPEG', 8, 20, 50, 15);
    doc.setDrawColor(150,150,150);
    //doc.text('Rapport derreur',x:20,y:30,w:40,h:30);

    if(typeOfReport=='mouvement'){
      doc.text('Rapport d\'Intgration des Mouvements', 68, 40, null, null, null);
    }
    else if(typeOfReport=='affiliation') {
      doc.text('Rapport d\'Intgration des Affiliations', 68, 40, null, null, null);
    }
    else if(typeOfReport=='instrument') {
      doc.text('Rapport d\'Intgration des Instruments', 68, 40, null, null, null);
    }
    else if(typeOfReport=='position') {
      doc.text('Rapport d\'Intgration des Positions', 68, 40, null, null, null);
    }
    doc.line(17, 45, 200, 45);
    doc.fromHTML(innerHTML, 17, 45, {
      'width': 190,
      'elementHandlers': specialElementHandlers,
    });

    doc.save(file);
    return file;
  }

}
